import React, { Component } from "react";
import { Row, Col } from "react-bootstrap";
import { Jumbotron, Button } from "react-bootstrap";
import mainImage from "../../img/header/Space_Needle002.jpg";
import './style.css';

class Main extends Component {
    constructor(props) {
      super(props);
      this.state = {};
    }

    render() {
        return (
            <Row>
                <Col xs={6}>
                    <Jumbotron className="mt-3 mb-5" id="jumbo">
                        <h1 className="ml-5">VKBE CONSULTING</h1>
                        <p className="ml-5">A Seattle based software consulting company</p>
                        <br></br>
                        <p className="ml-5">VKBE is a technology consulting firm specialized in delivering cloud solutions to our partners.</p>
                        <p className="ml-5">As certified professionals, we ensure that your infrastructure will have the performance, resilience and security for your applications to run at scale.</p>
                        <p className="ml-5">By leveraging Amazon Web Services, we are following the best practices of cloud computing. Our team is committed to understand your needs enabling us to deliver a reliable solution for your challenges.</p>
                        <p className="ml-5">Our mission is to create a seamless transition by providing you with the necessary resources and knowledge throughout your entire cloud journey.</p>
                        <p className="ml-5">
                            <Button rounded variant="primary">Read Less</Button>
                        </p>
                    </Jumbotron>
                </Col>
                <Col xs={6}>
                <img
                    alt="main image"
                    src={mainImage}
                    width="100%"
                    height="75%"
                    className="mt-5 mb-5"
                />
                </Col>
            </Row>
        )
    }
}

export default Main;
